actionConfiguration.body:
DivisionName => {
  console.log(DivisionName);
  storeValue('Division_Name', DivisionName);
  let filterDivision = appsmith.store.Data_Division.filter(item => item.Division === DivisionName);
  console.log(filterDivision);
  console.log(filterDivision.length);
  if (filterDivision.length > 0) {
    let positionList = filterDivision[0].Position?.map(position => position.name);
    let selectPositionObject = [];
    positionList.forEach(name => {
      selectPositionObject.push({
        label: name,
        value: name
      });
    });
    storeValue('List_Position', _.unionBy(selectPositionObject));
  } else {
    storeValue('List_Position', undefined);
    storeValue('Position_Name', undefined);
  }
}
